import React from 'react';
import './Expertise.css';
import expertiseLine from './images/expertiseimage.png';

function Expertise() {
  return (
    <>
      <div className='expertise-section'>
        <div className='expertise-container'>
          <div className='expertise-image-container'>
            <img
              className='expertise-image'
              src={expertiseLine}
              alt='expertise-line'
            />
          </div>
          <div className='quote-container'>
            <h1>
              zara rahim is a strategic advisor to <br />
              business leaders, startups, artists, <br />
              musicians, brands, media entities, meme- <br />
              lords, comedians, accidental villans, <br />
              heroes, and friends.
            </h1>
            <br />
            <p>- fran lebowitz</p>
          </div>
        </div>
      </div>
    </>
  );
}

export default Expertise;
